import React from 'react'
import styled from 'styled-components'
import {Link} from 'react-router-dom'
import logo from './logo.png'

const Nav = styled.nav`

    height: 60px;
    display: flex;
    justify-content: space-between;
    position: fixed;
    width: 100%;
    cursor: pointer;
    margin-top: -20px;
    margin-left: -10px;
    align-items: center;





`//border-bottom: 1px solid #00a2ff ;
const Logo=styled(Link)`
    color: white;
    height: 100%;
    align-items: center;
    display: flex;
    padding: 0rem 1rem;
    text-decoration: none;
    font-weight: bold;

`
const ColoredLine = ({ color }) => (
    <hr
        style={{
            color: color,
            backgroundColor: color,
            height: 5
        }}
    />
);





const NavBar = ()=>{
    return(
        <>
        <Nav>
            <Logo to="/"><img width="65px" height="auto" src={logo} alt="img"/></Logo>
        </Nav>
        <ColoredLine/>
        </>



    )
}
export default NavBar
